// insert operation - add new staff

import React, { useState } from "react";
import './AddOperations.css';
const url = "http://localhost:8000/staff"

const AddStaff = () => {

    const [name, setName] = useState("");
    const [role, setRole] = useState("");

    const handleStaffSubmit = async (e) => {
        e.preventDefault();

        const body = { name, role };
        const response = await fetch(url, {
            method: "POST",
            headers: { "Content-Type": "application/json"},
            body: JSON.stringify(body)
        });

        console.log(response);
        alert("Employee successfully added!");

        // clear input values in form
        setName('');
        setRole('');
    }

    return (
        <>
            <div className="box-container">
                <div className="text-container">
                    <h2>Register New Employees</h2>
                    <div className="name">
                        <form onSubmit={handleStaffSubmit}>
                            <label>Full Name: </label>
                                <input
                                    type="text"
                                    name="name"
                                    value={name}
                                    onChange={e => setName(e.target.value)}
                                    required />
                            <div className="formspace"></div>
                            <label>Role: </label>
                                <input
                                    type="text"
                                    name="role"
                                    value={role}
                                    onChange={e => setRole(e.target.value)}
                                    required />
                            <div className="formspace"></div>
                            <input type="submit" value="Add Staff" />
                        </form>
                    </div>
                </div>

                <div className="text-container">
                    <h2>Add a New Ride</h2>
                    <div className="name">
                        <form onSubmit={handleStaffSubmit}>
                            <label>Name: </label>
                                <input
                                    type="text"
                                    name="name"
                                    value={name}
                                    onChange={e => setName(e.target.value)}
                                    required />
                            <div className="formspace"></div>
                            <label>Park #: </label>
                                <input
                                    type="text"
                                    name="park"
                                    value={role}
                                    onChange={e => setRole(e.target.value)}
                                    required />
                            <div className="formspace"></div>
                            <label>Thrill Level: </label>
                                <input
                                    type="text"
                                    name="thrill"
                                    value={role}
                                    onChange={e => setRole(e.target.value)}
                                    required />
                            <div className="formspace"></div>
                            <label>Capacity: </label>
                                <input
                                    type="text"
                                    name="capacity"
                                    value={role}
                                    onChange={e => setRole(e.target.value)}
                                    required />
                            <div className="formspace"></div>
                            <input type="submit" value="Add Ride" />
                        </form>
                    </div>
                </div>

                <div className="text-container">
                    <h2>Add a New Shop</h2>
                    <div className="name">
                        <form onSubmit={handleStaffSubmit}>
                            <label>Full Name: </label>
                                <input
                                    type="text"
                                    name="name"
                                    value={name}
                                    onChange={e => setName(e.target.value)}
                                    required />
                            <div className="formspace"></div>
                            <label>Role: </label>
                                <input
                                    type="text"
                                    name="role"
                                    value={role}
                                    onChange={e => setRole(e.target.value)}
                                    required />
                            <div className="formspace"></div>
                            <input type="submit" value="Add Shop" />
                        </form>
                    </div>
                </div>

                <div className="text-container">
                    <h2>Add a New Food Establishment</h2>
                    <div className="name">
                        <form onSubmit={handleStaffSubmit}>
                            <label>Full Name: </label>
                                <input
                                    type="text"
                                    name="name"
                                    value={name}
                                    onChange={e => setName(e.target.value)}
                                    required />
                            <div className="formspace"></div>
                            <label>Role: </label>
                                <input
                                    type="text"
                                    name="role"
                                    value={role}
                                    onChange={e => setRole(e.target.value)}
                                    required />
                            <div className="formspace"></div>
                            <input type="submit" value="Add Dining" />
                        </form>
                    </div>
                </div>
            </div>
        </>
    );
};

export default AddStaff;
